<?php

namespace Database\Factories;

use Illuminate\Database\Eloquent\Factories\Factory;

class GuildFactory extends Factory
{
    private static $emblem_data = [
        '',
        '',
        '',
        '',
        '',
        '',
    ];
    private static $guild_id = 1;
    /**
     * Define the model's default state.
     *
     * @return array
     */
    public function definition()
    {
        return [
            'guild_id' => self::$guild_id++,
            'name'      => $this->faker->word,
            'master'    => $this->faker->word,
            'guild_lv'  => $this->faker->numberBetween(0, 50),
            'connect_member' => 0,
            'max_member' => 20,
            'average_lv'  => 0,
            'exp' => $this->faker->randomNumber(5),
            'next_exp' => $this->faker->randomNumber(),
            'skill_point' => 50,
            // 'mes1',
            // 'mes2',
            'emblem_len' => 20,
            // 'emblem_id',
            'emblem_data' => $this->faker->randomElement(self::$emblem_data),
            'last_master_change' => $this->faker->date(),
        ];
    }
}
